import { useMemo } from "react"
import { useTable } from "react-table"
import { format } from "date-fns";

type Props = {
    users: any
}

const MainTabel = ({ users }: Props) => {

    console.log(users)
    const data = useMemo(
        () => users,
        [users])

    const columns: any = useMemo(
        () => [
            {
                Header: 'ID',
                accessor: 'ID', // accessor is the "key" in the data
            },
            {
                Header: 'Имя',
                accessor: 'FirstName', // accessor is the "key" in the data
            },
            {
                Header: 'Город',
                accessor: 'City', // accessor is the "key" in the data
            },
            {
                Header: 'Активность роботов (кол-во)',
                accessor: 'Orientation', // accessor is the "key" in the data
                Cell: ({ value }: any) => 'активно' + value
            },
            {
                Header: 'Сумма счетов',
                accessor: 'ScansInPeriod', // accessor is the "key" in the data
            },
            {
                Header: 'Прибыль',
                accessor: 'VIP', // accessor is the "key" in the data
            },
            {
                Header: 'Дата регистрации',
                accessor: 'CreatedAt', // accessor is the "key" in the data
                Cell: ({ value }: any) => format(new Date(value), `dd.MM.yyyy`)
            },
            {
                Header: 'Комиссия',
                accessor: 'Ban', // accessor is the "key" in the data
            },
            {
                Header: 'Статус плательщика',
                accessor: 'State', // accessor is the "key" in the data
            },
        ],
        []
    )

    const {
        getTableProps,
        getTableBodyProps,
        headerGroups,
        rows,
        prepareRow,
    } = useTable({ columns, data })

    return (
        <table {...getTableProps()} style={{ border: 'solid 1px blue' }}>
            <thead>
                {headerGroups.map(headerGroup => (
                    <tr {...headerGroup.getHeaderGroupProps()}>
                        {headerGroup.headers.map(column => (
                            <th
                                {...column.getHeaderProps()}
                                style={{
                                    borderBottom: 'solid 3px red',
                                    background: 'aliceblue',
                                    color: 'black',
                                    fontWeight: 'bold',
                                }}
                            >
                                {column.render('Header')}
                            </th>
                        ))}
                    </tr>
                ))}
            </thead>
            <tbody {...getTableBodyProps()}>
                {rows.map(row => {
                    prepareRow(row)
                    return (
                        <tr {...row.getRowProps()}>
                            {row.cells.map(cell => {
                                return (
                                    <td
                                        {...cell.getCellProps()}
                                        style={{
                                            padding: '10px',
                                            border: 'solid 1px gray',
                                            background: 'papayawhip',
                                        }}
                                    >
                                        {cell.render('Cell')}
                                    </td>
                                )
                            })}
                        </tr>
                    )
                })}
            </tbody>
        </table>
    )
}

export default MainTabel
